                        </Container1Link>
                    </Container1Inner>
                </Container1>
            </Section>

            <Section>
                <Container2>
                    <Container2Inner>

                    </Container2Inner>
                </Container2>
            </Section>

            <Section>
                <Container3>
                    <span>Front-END</span>
                    <img src={js} className='jspng'/>
                </Container3>
            </Section>
        </SectionsContainer>
    );
}

export default Layout;
